  align-items: center;
  font-size: 16px;
  font-weight: 600;
  gap: 12px;
`;
const circleProfile = css`
  width: 2.5rem;
  height: 2.5rem;
  border-radius: 50%;
  background-color: #black;
`;

const score = css`
  display: flex;
  justify-content: flex-end;
`;

