const UserRow = () => {
  return (
    <div css={row}>
      <div css={ranking}>1</div>
      <div css={userInfo}>
        <div css={circleProfile}></div>
        <div>매우매우긴닉네임</div>
      </div>
      <div css={score}>1230429342034909</div>
    </div>
  );
};

export { UserRow, TopUserRow };
